import "./App.css";
import { Routes, Route, Switch } from "react-router-dom";
import Ateliers from "./pages/Ateliers";
import UsersPage from "./pages/Users";
import Action from "./pages/Action";
import Rate from "./pages/Rate";

function App() {
  return (
    <div className="w-screen min-h-screen flex justify-center items-center bg-igray flex-col space-y-28 scroll-smooth">
      <Routes>
        <Switch>
          <Route path="/rate/:id" element={<Rate />} />
          <Route path="/ateliers/:id" element={<Ateliers />} />
          <Route path="/ateliers/1/:id" element={<Action />} />
          <Route path="/ateliers/2/:id" element={<Action />} />
          <Route path="/ateliers/3/:id" element={<Action />} />
          <Route path="/" element={<UsersPage />} />
        </Switch>
      </Routes>
    </div>
  );
}

export default App;
